const FinanceCard = ({income, expense, from, to}) => {

    const porcentajeComision = 0.10
    function comision(income, porcentajeComision) {
        return (income * porcentajeComision)
    }
    console.log(income)
    console.log('Esto es comision' + comision)

    return (
        <div className='m-2 flex flex-row justify-center'>
            <p>Estado de Cuenta desde {from} hasta el {to}</p>
            <div className='flex flex-row '>
                <p className='font-medium text-lg m-2 mx-4'>El ingreso es {income}</p>
                <p className='font-medium text-lg m-2 mx-4'>El egreso es {expense}</p>
                <p className='font-medium text-lg m-2 mx-4'>La comisión por administración es {() => comision()}</p>
            </div>
        </div>
    )
}

export default FinanceCard
